import React from 'react';
import { Link } from 'react-router-dom';
import { Compass } from 'lucide-react';

/**
 * Navbar for public-facing pages (Home, Login, Register).
 * It displays the brand and navigation links for unauthenticated users.
 */
const Navbar = () => {
    return (
        <nav className="bg-white/80 backdrop-blur-sm shadow-sm sticky top-0 z-50">
            <div className="max-w-7xl mx-auto px-6 py-3 flex justify-between items-center">
                <Link to="/home" className="flex items-center space-x-2">
                    <Compass className="w-8 h-8 text-blue-600" />
                    <span className="text-2xl font-bold text-gray-800">TravelPartner</span>
                </Link>
                <div className="flex items-center space-x-2 sm:space-x-4">
                    <Link to="/login" className="text-gray-600 hover:text-blue-600 font-medium transition-colors px-3 py-2 rounded-md">
                        Login
                    </Link>
                    <Link to="/register" className="bg-blue-600 text-white px-4 py-2 rounded-lg hover:bg-blue-700 transition-colors font-semibold">
                        Sign Up
                    </Link>
                </div>
            </div>
        </nav>
    );
};

export default Navbar;
